VALUES ('3537580707274', 'Panier Gourmand', 'Pâté Hénaff Epicé : Viande de porc (91%) dont jambon (20%), fumet, foie de porc (2.5%), épices (1,7%), sel de mer.  Terrine Bretonne Hénaff : Viande de porc, foie de porc, gras de porc, blanc d\'_oeuf_, couenne de porc, oignons, fécule de pomme de terre, sel, épices, conservateur : nitrite de sodium. Colorant : caramel ordinaire. Pâté Hénaff ail et fines herbes : Viande de porc * (87%), fumet, ail (0.9 %), fines herbes (3.5%) (ciboulette, persil, cerfeuil, estragon), foie de porc * (1.4 %), sel de Guérande, épices. * Origine France Pâté Hénaff : Viande de porc (91%) dont jambon (20%), fumet, foie de porc (1,5%), sel de Guérande (1.5%), épices. Terrine de lapin au Serpolet Hénaff : Viande de porc, viande de lapin (20%), gras de porc, foie de poulet, foie de porc, _oeuf_, couenne, vin blanc, Armagnac, sel de mer, épices, Serpolet (0.1%), ail. Rillettes à l\'ancienne Hénaff : Viande de porc (90 %), gras de porc, sel de mer, poivre. Rillettes de maquereaux à la tomate : _Maquereau_ (60%), tomates mi-séchées (15%) (tomate, huile de tournesol, sel, ail, herbes), huile d’olive, oignon, échalote, sel de mer, fibre de carotte, protéines de _lait_, herbes aromatiques, épaississants : gomme xanthane, gomme guar, sucre, poivre. Rillettes thon au basilice Ma Tartine Hénaff : _Thon_ (54%), oignon, huile de colza, eau, basilic (3%), fibre de carotte, protéines de _lait_, sel de mer, épaississants : gomme xanthane, gomme guar, arôme naturel (_poissons_, _mollusques_, _crustacés_, _lait_), épices. ', '', '20', '9', '0.5', '0.2', '', '17', '1.5', '0.590551181102362', '', '0');

