VALUES ('3540740100105', 'Miel\' nou', 'C\'est un produit parfaitement naturel. Ce miel possède une très grande valeur nutritive et thérapeutique grâce à sa composition : des sucres (en particulier des sucres simples), des protéines, des sels minéraux, des oligo-éléments, des enzymes digestifs, des acides organiques, des substances aromatiques essentielles, substance antibiotique, des grains de pollen, des pigments. Le miel possède bien des propriétés qu\'il doit aux plantes ayant produit les nectars butinés. Les miel peut se présenter sous différentes formes : fluide, épaisse ou cristallisée. Le miel peut étre consommé tous les jours, naturel, en tartine, ou pour sucrer les boissons ou tes tisanes, les glaces, les gâteaux etc...', '', '10', '6', '76.4', '60', '0.2', '0.4', '0.72', '0.283464566929134', '', '0');

